// src/GamezopEmbed.js
import React from 'react';
import Header from '../header/Header';
import Footer from '../footer/Footer';

const QuizComponent = () => {
 const gameUrl = 'https://www.newszop.com/';
// const gameUrl = 'https://play.gamezop.com/te/intro?int-nav=1'

const horoscope  ="https://www.astrozop.com/"
// const gameUrl ="https://www.criczop.com/"

  return (
    <div className='container-fluid'>
     <Header/>

<div className='row'>
  <div className='col'>
  <div className="game-container">
  <iframe
    title="Gamezop Game"
    src={gameUrl}
    className="game-iframe"
  />
</div>
  </div>
</div>

      <Footer/>

    </div>

  );
};

export default QuizComponent;
